import { createSlice } from "@reduxjs/toolkit";

const userslice = createSlice({
  name: "issues",
  initialState: { toDo: "", inProgress: "", done: "" },
  reducers: {
    login: (state, action) => {
      state = action.payload;
    },
  },
});

export const { login } = userslice.actions;
export default userslice;
